import React, { useState, useEffect } from 'react';
import axios from 'axios';

const DashboardDirector = ({ token, rol }) => {
  const [data, setData] = useState({ total_empresa: 0, total_vales: 0, promotores: [], cajeros: [], clientes: [] });
  const [error, setError] = useState('');

  useEffect(() => {
    const endpoint = rol === 'director' ? '/dashboard/director' : '/dashboard/supervisor';
    axios.get(`http://localhost:8000${endpoint}`, {
      headers: { Authorization: `Bearer ${token}` }
    })
      .then(res => setData(res.data))
      .catch(() => setError('Error al cargar los datos'));
  }, [token, rol]);

  return (
    <div className="p-4">
      <h1 className="text-2xl">{rol === 'director' ? 'Dashboard Director' : 'Dashboard Supervisor'}</h1>
      {error && <div className="alert alert-error">{error}</div>}
      <p>Total Empresa: ${data.total_empresa}</p>
      <p>Total Vales: {data.total_vales}</p>
      {rol === 'director' && <p>Pagos Pendientes: ${data.pagos_pendientes}</p>}
      <h2 className="text-xl mt-4">Promotores</h2>
      <table className="border w-full">
        <thead>
          <tr>
            <th className="border">Nombre</th>
            <th className="border">Total Vales</th>
            <th className="border">Monto Total</th>
            {rol === 'director' && <th className="border">Pagos Pendientes</th>}
          </tr>
        </thead>
        <tbody>
          {data.promotores.map(p => (
            <tr key={p.nombre}>
              <td className="border">{p.nombre}</td>
              <td className="border">{p.total_vales}</td>
              <td className="border">{p.monto_total}</td>
              {rol === 'director' && <td className="border">{p.pagos_pendientes}</td>}
            </tr>
          ))}
        </tbody>
      </table>
      <h2 className="text-xl mt-4">Cajeros</h2>
      <table className="border w-full">
        <thead>
          <tr>
            <th className="border">Nombre</th>
            <th className="border">Total Vales</th>
            <th className="border">Monto Total</th>
            {rol === 'director' && <th className="border">Pagos Pendientes</th>}
          </tr>
        </thead>
        <tbody>
          {data.cajeros.map(c => (
            <tr key={c.nombre}>
              <td className="border">{c.nombre}</td>
              <td className="border">{c.total_vales}</td>
              <td className="border">{c.monto_total}</td>
              {rol === 'director' && <td className="border">{c.pagos_pendientes}</td>}
            </tr>
          ))}
        </tbody>
      </table>
      {rol === 'director' && (
        <>
          <h2 className="text-xl mt-4">Clientes</h2>
          <table className="border w-full">
            <thead>
              <tr>
                <th className="border">Nombre</th>
                <th className="border">Total Vales</th>
                <th className="border">Monto Total</th>
                <th className="border">Pagos Pendientes</th>
              </tr>
            </thead>
            <tbody>
              {data.clientes.map(c => (
                <tr key={c.nombre}>
                  <td className="border">{c.nombre}</td>
                  <td className="border">{c.total_vales}</td>
                  <td className="border">{c.monto_total}</td>
                  <td className="border">{c.pagos_pendientes}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </>
      )}
    </div>
  );
};

export default DashboardDirector;
